import {BrowserRouter,Routes,Route } from "react-router-dom";

 const rootElement = document.getElementById('root')
render(
  <BrowserRouter>
  <Routes>
    <Route path="Registrarse" element={<Registrarse />} />
  </Routes>
</BrowserRouter>, rootElement

);

